import React from 'react';
import './NavBar.css';

const nelsonMuntz = {
    blockquote : 'Shoplifting is a victimless crime, like punching someone in the dark.',
    cite : "Nelson Muntz",
    }


function QuoteCards(props){
  return (
    <figure class="QuoteCard">
    <img
      src="https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FNelsonMuntz.png?1497567511185"
      alt={props.cite} />
    <figcaption>
      <blockquote>
        {props.blockquote}
      </blockquote>
      <cite>{props.cite}</cite>
    </figcaption>
  </figure>
  );
const homer ={
  quote	:"Can't we have one meeting that doesn't end with us digging up a corpse?",
  character:	"Mayor Quimby",
  image:	"https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FMayorQuimby.png?1497627527799",
  characterDirection:	"Left"
}


}

export default QuoteCards;
